return ['x-generator'=>'GlotPress/4.0.1','translation-revision-date'=>'2024-12-29 17:47:48+0000','plural-forms'=>'nplurals=3; plural=(n % 10 == 1 && n % 100 != 11) ? 0 : ((n % 10 >= 2 && n % 10 <= 4 && (n % 100 < 12 || n % 100 > 14)) ? 1 : 2);','project-id-version'=>'Themes - Twenty Twenty-Four','language'=>'uk_UA','messages'=>['Twenty Twenty-Four is designed to be flexible, versatile and applicable to any website. Its collection of templates and patterns tailor to different needs, such as presenting a business, blogging and writing or showcasing work. A multitude of possibilities open up with just a few adjustments to color and typography. Twenty Twenty-Four comes with style variations and full page designs to help speed up the site building process, is fully compatible with the site editor, and takes advantage of new design tools introduced in WordPress 6.4.'=>'Twenty Twenty-Four призначений бути гнучким, універсальним та застосовним до будь-якого веб-сайту. Його колекція шаблонів та патернів відповідає різним потребам, таким як презентація бізнесу, блогінг та письмо або демонстрація робіт. Багато можливостей відкриваються лише з декількома налаштуваннями кольору та типографії. Twenty Twenty-Four має варіації стилю та повні дизайни сторінок, що допомагають прискорити процес побудови сайту, повністю сумісний з редактором сайту та використовує нові інструменти дизайну, представлені в WordPress 6.4.','Twenty Twenty-Four'=>'Twenty Twenty-Four','Pattern descriptionA centered text statement with a large amount of padding on all sides.'=>'Відцентрований текст з великою кількістю відступів з усіх боків.','Pattern titlePosts heading'=>'Заголовок записів','Pattern descriptionA title, a paragraph and a CTA button on the left with an image on the right.'=>'Заголовок, абзац і кнопка заклику до дії (CTA) ліворуч із зображенням праворуч.','Pattern descriptionA text-only section for project details.'=>'Тільки текстовий розділ для деталей проекту.','Pattern descriptionA feature grid of 2 rows and 3 columns with headings and text.'=>'Сітка функцій з 2 рядків і 3 стовпців з заголовками та текстом.','Question in the FAQ patternWho is behind Études?'=>'Хто стоїть за Études?','Pattern descriptionA FAQ section with a large FAQ heading and a group of questions and answers.'=>'Розділ поширених запитань з великим заголовком і групою запитань та відповідей.','Pattern descriptionA centered italic text statement with compact padding.'=>'Відцентрований курсивний текст із компактними відступами.','Pattern descriptionA text section, then a two-column section with text in one column and an image in the other.'=>'Текстовий розділ, потім розділ з двох колонок з текстом в одній колонці та зображенням в іншій.','Pattern descriptionA centered testimonial section with an avatar, name, and job title.'=>'Відцентрований розділ відгуків з аватаром, ім\'ям та посадою.','Pattern descriptionA team section, with a heading, a paragraph, and 4 columns for team members.'=>'Розділ для команди із заголовком, абзацом і 4 колонками для членів команди.','Pattern descriptionA list of posts without images, 1 column.'=>'Перелік записів без зображень, 1 колонка','Pattern descriptionA list of posts with featured images only, 4 columns.'=>'Перелік записів лише з вибраними зображеннями, 4 колонки.','Pattern descriptionA list of posts with featured images only, 3 columns.'=>'Перелік записів лише з вибраними зображеннями, 3 колонки.','Pattern descriptionA grid of posts featuring the first post, 2 columns.'=>'Сітка записів з відображенням першого запису, 2 колонки.','Pattern descriptionA list of posts, 3 columns.'=>'Перелік записів, 3 колонки.','Pattern descriptionA list of posts, 1 column.'=>'Перелік записів, 1 колонка.','Pattern descriptionA full portfolio page with a section for project description, project details, a full screen image, and a gallery section with two images.'=>'Повна сторінка портфоліо з розділом для опису проєкту, деталями проєкту, зображенням на вес