ультації, управління, дизайн та дослідницькі рішення. Кожна архітектурна справа - це можливість впливати на майбутнє.','Pattern titleTitle text and button on left with image on right'=>'Текст заголовка та кнопки зліва з зображенням справа','Descriptive text for the feature areaThe revitalized Art Gallery is set to redefine the cultural landscape of Toronto, serving as a nexus of artistic expression, community engagement, and architectural marvel. The expansion and renovation project pay homage to the Art Gallery\'s rich history while embracing the future, ensuring that the gallery remains a beacon of inspiration.'=>'Реконструйована художня галерея призначена переосмислити культурний пейзаж Торонто, служити вузлом художнього вираження, залучення спільноти та архітектурного дива. Проект розширення та реконструкції вшановує багату історію художньої галереї, одночасно сприймаючи майбутнє, забезпечуючи, що галерея залишиться символом натхнення.','Descriptive title for the feature areaWith meticulous attention to detail and a commitment to excellence, we create spaces that inspire, elevate, and enrich the lives of those who inhabit them.'=>'З великою увагою до деталей та зобов\'язанням до відмінностей ми створюємо простори, які надихають, піднімають та збагачують життя тих, хто їх населяє.','Title text for the feature areaThe revitalized art gallery is set to redefine cultural landscape.'=>'Оновлена художня галерея призначена переосмислити культурний ландшафт.','Pattern titleProject details'=>'Деталі проєкту','Sample contentExperience the fusion of imagination and expertise with Études Architectural Solutions.'=>'Відчуйте поєднання уяви та експертизи з Études Architectural Solutions.','Sample headingArchitectural Solutions'=>'Архітектурні рішення','Sample feature headingProject Management'=>'Керування проектом','Sample feature headingConsulting'=>'Консультування','Sample feature headingApp Access'=>'Доступ до додатку','Sample feature headingContinuous Support'=